import React, { useState } from "react";

const Register = () => {
  const [formData, setFormData] = useState({
    pnombre: "",
    ubicacion: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    snombre: "",
    papellido: "",
    sapellido: "",
    usuario: {
      login: "",
      password: "",
    },
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("usuario.")) {
      const usuarioField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        usuario: { ...prevData.usuario, [usuarioField]: value },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const dataToSend = {
      pnombre: formData.pnombre,
      ubicacion: formData.ubicacion,
      identificacion: parseInt(formData.identificacion),
      email: formData.email,
      fechaNacimiento: formData.fechaNacimiento, // Asegúrate de que esta sea una fecha válida
      snombre: formData.snombre,
      papellido: formData.papellido,
      sapellido: formData.sapellido,
      usuario: {
        login: formData.usuario.login,
        password: formData.usuario.password,
      },
    };

    fetch("http://localhost:8080/Laboratorio1/persona", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(dataToSend),
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Error en la solicitud");
        }
        return response.json();
      })
      .then((data) => {
        console.log("Éxito:", data);
        // Puedes agregar lógica adicional aquí, como redirigir o limpiar el formulario
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };

  return (
    <div>
      <h2>Agregar Persona</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Primer Nombre:</label>
          <input
            type="text"
            name="pnombre"
            value={formData.pnombre}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Ubicación:</label>
          <input
            type="text"
            name="ubicacion"
            value={formData.ubicacion}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Identificación:</label>
          <input
            type="number"
            name="identificacion"
            value={formData.identificacion}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Fecha de Nacimiento:</label>
          <input
            type="date"
            name="fechaNacimiento"
            value={formData.fechaNacimiento}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Segundo Nombre:</label>
          <input
            type="text"
            name="snombre"
            value={formData.snombre}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Primer Apellido:</label>
          <input
            type="text"
            name="papellido"
            value={formData.papellido}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Segundo Apellido:</label>
          <input
            type="text"
            name="sapellido"
            value={formData.sapellido}
            onChange={handleChange}
          />
        </div>
        <h3>Usuario</h3>
        <div>
          <label>Login:</label>
          <input
            type="text"
            name="usuario.login"
            value={formData.usuario.login}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            name="usuario.password"
            value={formData.usuario.password}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit">Guardar</button>
      </form>
    </div>
  );
};

export default Register;
